package javaBasicAssignmnet;

public class Question21 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<5;i++) {
			System.out.println("12345");
		}
		System.out.println("\n");
		for(int i=1;i<=5;i++) {
			for(int j=0;j<5;j++) {
				System.out.print(i);
			}
			System.out.println();
		}
		System.out.println("\n");
		for(int i=1;i<=4;i++) {
			for(int j=1;j<=i;j++) {
				System.out.print("1");
			}
			System.out.println();
		}
	}

}
